import React, { useEffect, useState } from "react";
import { Link, useParams } from "react-router-dom";
import axiosInstance from "../../baseurl";

function ViewTutorialFull() {
  const { id } = useParams();
  const [video,setvideo] = useState({})

  useEffect(() => {
    console.log(id);
    axiosInstance
      .post(`/viewTutorialByTrainerId/${id}`)
      .then((res) => {
        console.log(res, "result video");
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return <div>
    <Link className="btn btn-primary" to={`/Customer/CustomerViewTutorials/${id}`}> Back to Tutorials</Link>
    {/* <video width='100%' height='500' controls>
      <source  src={`http://localhost:4002/${id}`}/>
    </video> */}
  </div>;
}

export default ViewTutorialFull;
